import {Component} from "react";


export class NavBar extends Component {

    constructor(props:{}) {
        super(props);
    }
    render(){
        return(
            <nav className="navbar navbar-inverse navbar-fixed-top" id="sidebar-wrapper" role="navigation">
                <ul className="nav sidebar-nav">
                    <li className="sidebar-brand">
                        <a href="#">
                            管理系统
                        </a>
                    </li>

                    <li className="dropdown open">
                        {/*<a href="#" className="dropdown-toggle" data-toggle="dropdown" aria-expanded="true"><i className="fa fa-fw fa-plus"></i> 目的 <span className="caret"></span></a>*/}
                        <ul className="dropdown-menu" role="menu">
                            <li><a href="/sell/seller/product/list">拉新</a></li>
                            <li><a href="/sell/seller/product/index">促活</a></li>
                            <li><a href="/sell/seller/product/index">留存</a></li>
                            <li><a href="/sell/seller/product/index">转化</a></li>
                        </ul>
                    </li>
                    <li className="dropdown open">
                        {/*<a href="#" className="dropdown-toggle" data-toggle="dropdown" aria-expanded="true"><i className="fa fa-fw fa-plus"></i> 数据分析 <span className="caret"></span></a>*/}
                        <ul className="dropdown-menu" role="menu">
                            <li><a href="/sell/seller/category/list">裂变数据分析</a></li>
                            <li><a href="/sell/seller/category/index">市场数据分析</a></li>
                        </ul>
                    </li>

                </ul>
            </nav>
        );
    }


}
